import './App.css';
import logo from './assets/logo.png';
import people from './assets/happytable.jpg';
import people2 from './assets/people2.jpg';
import fish from './assets/fish.jpg';
import SimpleImageSlider from "react-simple-image-slider";
import wa from './assets/whatsapp.png';
import phone from './assets/phone.png';
import location from './assets/location.png'

function App() {
  const MenuItem = ({ title }) => {
    return (
      <div style={{ fontSize: 16, color: '#fff', fontWeight: 'bold', fontFamily: 'monospace' }}>
        {title}
      </div>
    )
  }
  return (
    <div className='App' style={{ height: '100vh', width: '100vw' }}>
      {/* header */}
      <div style={{ width: '100%', display: 'flex', flexDirection: 'row', alignItems: 'center' }}>
        <img src={logo} style={{ height: 80, width: 80, margin: 20 }} />
        <div style={{ color: '#fff', fontWeight: 'bold', fontSize: 30, fontFamily: 'cursive' }}>Gold Fish</div>
        <div style={{ display: 'flex', flexDirection: 'row', flex: 1, height: 50, alignItems: 'center', justifyContent: 'flex-end', columnGap: 35, marginRight: 40 }}>
          <MenuItem title="HOME" />
          <MenuItem title="ABOUT" />
          <MenuItem title="MENU" />
          <MenuItem title="CONTACTS" />
        </div>
      </div>
      {/* header end */}

      {/* body */}
      <div style={{ width: '100%', flexDirection: 'row', display: 'flex', marginTop: 80, justifyContent: 'space-between' }}>
        <div style={{ marginLeft: 120 }}>
          <div style={{ fontWeight: 'bold', fontSize: 60, color: '#fff' }}>
            Lorem ipsum dolor
          </div>
          <div style={{ fontWeight: 'bold', fontSize: 40, color: '#fff' }}>
            sit amet
          </div>

          <div style={{ fontWeight: '400', fontSize: 14, color: '#fff', maxWidth: 400, marginTop: 30 }}>
            consectetur adipiscing elit. Nullam at enim eget dui lobortis tempor. Nulla bibendum convallis urna a bibendum. Curabitur sem lectus
          </div>

          <div style={{
            height: 50, width: 200, borderRadius: 10, display: 'flex',
            backgroundColor: '#e6b515', marginTop: 50, alignItems: 'center',
            justifyContent: 'center', color: '#000', fontWeight: 'bold'
          }}>
            BOOK A TABLE
          </div>
        </div>

        <div style={{ height: 450, width: 700, marginRight: 120 }}>
          <SimpleImageSlider
            width={700}
            height={450}
            images={[fish, people, people2]}
            showBullets={true}
            showNavs={true}
            loop
            autoPlay
            autoPlayDelay={4}
          />

        </div>
        <div style={{width: '100%', height: 60, position: 'absolute', bottom: 0, display: 'flex', flexDirection: 'row', columnGap: 30}}>
          <img src={wa} style={{height: 30, width: 30, marginLeft: 30}}/>
          <img src={phone} style={{height: 30, width: 30}}/>
          <img src={location} style={{height: 30, width: 30}}/>
        </div>

      </div>
    </div>
  );
}

export default App;
